    //   </Container>
    // </Navbar>
    <>
         <div class="section full mt-2">
            <div class="section-title">with Button</div>
            <div class="content-header mb-1">Or use a classic button</div>
            {/* App Header */}
            <div class="appHeader">
                <div class="left">
                    <a href="#" class="headerButton">
                        <ion-icon name="chevron-back-outline"></ion-icon>
                    </a>
                </div>
                <div class="pageTitle">Title</div>
                <div class="right">
                    <a href="#" class="headerButton">
                        <span class="btn btn-primary">Save</span>
                    </a>
                </div>
            </div>
            {/* App Header */}
        </div>
    </>
  );
}

export default PageNavbar;
